		private int seed;
		private int index;
		private int numAddSeed;

		public DTDeterministicRandom()
		{
			this.seed = 0;
			this.index = 0;
			this.numAddSeed = 0;
		}

		public DTDeterministicRandom(int seed)
		{
			this.seed = seed;
			this.index = 0;
			this.numAddSeed = 0;
		}

		public string SerializeToString()
		{
			string seedStr = this.seed.ToStringCultureInvariant();
			string indexStr = this.index.ToStringCultureInvariant();
			string numAddSeedStr = this.numAddSeed.ToStringCultureInvariant();

			return seedStr + " " + indexStr + " " + numAddSeedStr;
		}

		public void DeserializeFromString(string str)
		{
			string[] array = str.Split(' ');

			this.seed = StringUtil.ParseInt(array[0]);
			this.index = StringUtil.ParseInt(array[1]);
			this.numAddSeed = StringUtil.ParseInt(array[2]);
		}

		public void AddSeed(int i)
		{
			this.seed = unchecked(this.seed + 17 * i);
			this.seed = this.seed ^ i;
			this.seed = unchecked(this.seed + 1);

			this.numAddSeed = unchecked(this.numAddSeed + 1);

			this.seed = unchecked(this.seed + this.numAddSeed + this.numAddSeed * this.numAddSeed * 2);
		}

		public void Reset()
		{
			this.seed = 0;
			this.index = 0;
			this.numAddSeed = 0;
		}

		public int NextInt(int i)
		{
			if (i == 1)
				return 0;

			int next = unchecked(this.array[this.index] + this.seed);

			this.index = this.index + 1;
			if (this.index == this.array.Length)
			{
				this.index = 0;
				this.seed = unchecked(this.seed + 1);
			}

			// Note that if next is int.MinValue, next = -next
			// does nothing and next will still be negative.
			if (next < 0)
				next = unchecked(-next);

			if (next < 0)
				next = 0;

			return next % i;
		}

		public bool NextBool()
		{
			return this.NextInt(2) == 1;
		}
